import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import {Dimensions, View, Text, ScrollView, StyleSheet, TouchableHighlight, ImageBackground} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const image = { uri: "https://cdn.pixabay.com/photo/2016/05/22/20/13/background-1409125_960_720.png" };
const {width, height} = Dimensions.get('window')

function Menu({navigation}) {
const onPressLogout = () => {console.log('salir')}

return (
  <View style={styles.menu}>
    <ScrollView>
    <TouchableHighlight onPress={onPressLogout}>
      <View>
        <Icon name="sign-out" color="orange" size={25} />
      </View>
    </TouchableHighlight>
    </ScrollView>
  </View>
);
}

const styles = StyleSheet.create({
  menu: {
    backgroundColor: '#1D3448',
    flex: 1,
    width:width/2,
    height:height,
  }
});

export default Menu;
